customQuery\":null,\"customText\":\"\",\"target\":\"\",\"title\":\"\",\"type\":\"entry\",\"value\":null}',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(356,2242,1,'Sunrise','2020-01-22 02:07:42','2020-01-22 02:07:42','635473a3-d267-40dd-a98c-46f3de7d2c74','{\"ariaLabel\":\"\",\"customQuery\":null,\"customText\":\"\",\"target\":\"\",\"title\":\"\",\"type\":\"entry\",\"value\":null}',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(357,2243,1,'Sure Comfort Air Handler Training','2020-01-22 02:10:36','2020-01-22 02:19:59','54feab82-73c8-4241-b763-872f4933dcca',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,27,'ACR Training Facility: 4040 S. Alston Ave., Durham, NC 27113',NULL,75.00,NULL,NULL,NULL,NULL,NULL,'[]',NULL,NULL,NULL,NULL),(359,2245,1,'Course #331-FX Field Controller Engineering','2020-01-22 02:27:54','2020-04-01 03:48:33','0610bae2-ebf9-4776-8a28-68b0ae5191be',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'ACR Supply 4040 S. Alston Ave. Durham NC, 27713',NULL,1650.00,NULL,NULL,NULL,NULL,'<p><strong>This event has been cancelled due to COVID-19.</strong></p><p><br /></p><p>Prerequisite: ACR Controls PM approval or have taken Course #231 basics</p><p>Date: April 27-May 1 </p><p>Course Length: 3.5 Days 8am-4pm; 8am-11am Friday May 1</p><p>Location: ACR Supply 4040 S. Alston Ave. Durham NC, 27713</p><p>This course is designed for those who need advanced training on the Facilities Explorer platform.</p><p>Participants will receive an overview of the Facility Explorer MSTP, CCT, PCT Field Controller system, create programs from standard tree systems using the programmable Controller and Commissioning Tool, then connect using the MAP sensor to upload and download code into the controllers after setting up the hardware and software to communicate properly.</p><p><strong>Note:</strong> All class room materials are provided. Lunch and snacks included.</p><p>For End Users and/or Authorized Building Controls Specialists/Contractors only.</p><p><strong>Topics:</strong></p><ul><li>Introduction to the Facility Explorer MSTP Field Controllers System</li><li>Creating Applications Using the Standards Tree</li><li>Adding Points to Existing Controllers</li><li>Establish Peer to Peer Communications</li><li>Using MAP sensor to Connect to Controllers; Discussion of Bluetooth Setup for BTCVT</li><li>Uploading and Downloading Controllers</li><li>Commissioning Controllers, Inputs and Outputs</li><li>Introduction to Wireless Zigbee systems</li><li>Sideloops</li><li>Introduction to Custom Programming</li></ul><p><strong>About The Instructor:</strong></p><p>Ron Auvil has over 40 years of HVAC and Controls Experience. He has worked as a senior controls technician for Johnson Controls. He has also taught HVAC and Controls classes across the United States for Johnson Controls, Honeywell, and others. He has written several textbooks; HVAC and Refrigeration Systems, HVAC Control Systems and IT for HVAC Technicians, all both from American Technical Publishers..</p>','[]',NULL,NULL,NULL,NULL),(360,2246,1,'Course #304 - Commercial HVAC Bootcamp','2020-01-22 02:29:16','2020-01-22 02:29:16','901c1d5a-f460-4411-99f6-9315397e661a',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,7,'ACR Supply 200 Seneca Rd, Greensboro NC 27406',NULL,595.00,NULL,NULL,NULL,NULL,'<p> ($595 per person)</p><p>During this training your team will obtain an in-depth knowledge of typical commercial HVAC building systems. Identify major control system types and components. Save money with fewer service calls and complaints. Prepare technicians for advanced DDC and mechanical skills.</p><p>Prerequisite: None</p><p>Date: February 11-12</p><p>Course Length: 2 Day 8am-4pm</p><p>Location: ACR Supply 200 Seneca Rd, Greensboro NC 27406	</p><p><strong>Who the course is for:</strong></p><ul><li>New hires, especially residential technicians now working in a commercial building environment. </li><li>HVAC service technicians</li><li>Maintenance Staff, colleges, hospitals, and schools</li></ul><p> <strong>Skills Learned:</strong></p><ul><li>Importance of comfort in commercial buildings. </li><li>Typical commercial building HVAC systems with emphasis on VAV.</li><li>Hot water and chilled water piping systems including 2 pipe changeover and primary secondary.</li><li>Typical chiller plant sequence of operation.</li><li>Chiller and cooling tower operation.</li><li>Commercial boiler types and operation. </li><li>Control system components, including inputs, outputs, and control loops.</li><li>Air handler types and configurations.</li><li>Economizer control types.</li><li>Hands on labs.</li></ul><p><strong>About The Instructor:</strong></p><p>Ron Auvil has 40 years of HVAC and Controls Experience. He has worked as a senior controls technician for Johnson Controls. He has also taught HVAC and Controls classes across the United States for Johnson Controls, Honeywell, and others. He has written several textbooks; HVAC and Refrigeration Systems and HVAC Control Systems both from American Technical Publishers.</p>','[]',NULL,NULL,NULL,NULL),(361,2247,1,'Course #303 Chiller Operation and Troubleshooting','2020-01-22 02:30:10','2020-04-01 03:47:38','cfda7cc0-64c9-43b2-a0ea-87a69891ce88',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'<p><strong>This event has been cancelled due to COVID-19.</strong><br /></p><p>($599 per person)</p><p>Prerequisite: Basic Air Conditioning Experience</p><p>Date: April 7-8</p><p>Course Length: 2 Days 8am-4pm</p><p>Location: ACR Supply 4040 S. Alston Ave, Durham NC 27713</p><p>Get a better understanding of how Centrifugal Chillers work! This course provides an in-depth look at the refrigeration cycle for a typical centrifugal chiller. In addition, typical preventive maintenance procedures are covered as well. Chiller Plant Efficiency topics are covered. The class will finish up by looking at the most common troubleshooting problems for centrifugal chillers. </p><p><strong>Course Topics:</strong></p><ul><li>Basic Centrifugal Chiller Refrigeration Cycle</li><li>Typical Centrifugal Chiller ARI Baseline Performance</li><li>Types of Chillers</li><li>Refrigerants and Purge Operation</li><li>Evaluating Chiller Efficiency; IPLV and NPLV</li><li>Cooling Tower Types and Efficiency. </li><li>Typical Chiller and Tower Maintenance Procedures</li><li>Chiller and Tower Diagnostics</li><li>Troubleshooting the Most Common Centrifugal Problems</li><li>Typical Chiller Plant Layout.</li><li>Chiller Manual/Emergency Startup Procedures</li><li>Chiller Control Sequences and Types. </li></ul><p><strong>About The Instructor:</strong></p><p>Ron Auvil has over 40 years of HVAC and Controls Experience. He has worked as a senior controls technician for Johnson Controls. He has also taught HVAC and Controls classes across the United States for Novar Controls, Johnson Controls, Honeywell, and others. He has written several textbooks; HVAC and Refrigeration Systems, HVAC Control Systems and IT for HVAC Technicians, all both from American Technical Publishers. </p>','[]',NULL,NULL,NULL,NULL),(362,2248,1,'2020-01-23 00:42:49','2020-01-23 05:42:49','2020-01-23 05:42:49','52a1695f-11dd-46e5-b9af-f56ebe8023b7',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(363,2249,1,'2020-01-24 12:48:25','2020-01-24 17:48:25','2020-01-24 17:48:25','5e6661aa-b014-4560-9405-35258a4daa1e',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(364,2250,1,'2020-01-24 17:29:40','2020-01-24 22:29:40','2020-01-24 22:29:40','e4a24b5b-2322-487a-a299-69595f7d8962',NULL,NULL,NULL,