er. Chiller Plant Efficiency topics are covered and look at the most common troubleshooting problems for centrifugal chillers. </p><p>Prerequisite: Basic Air Conditioning Experience</p><p><strong>COURSE TOPICS:</strong></p><ul><li>Basic Centrifugal Chiller Refrigeration Cycle</li><li>Typical Centrifugal Chiller ARI Baseline Performance</li><li>Types of Chillers</li><li>Refrigerants and Purge Operation</li><li>Evaluating Chiller Efficiency; IPLV and NPLV</li><li>Cooling Tower Types, Maintenance and Efficiency. </li><li>Chiller and Tower Diagnostics</li><li>Troubleshooting the Most Common Centrifugal Problems</li><li>Typical Chiller Plant Layout.</li><li>Chiller Manual/Emergency Startup Procedures</li><li>Chiller Control Sequences and Types. </li></ul><p><strong>About The Instructor:</strong></p><p>Ron Auvil has over 40 years of HVAC and Controls Experience. He has worked as a senior controls technician for Johnson Controls. He has also taught HVAC and Controls classes across the United States for Novar Controls, Johnson Controls, Honeywell, and others. He has written several textbooks; HVAC and Refrigeration Systems, HVAC Control Systems and IT for HVAC Technicians, all both from American Technical Publishers. </p>','[]',NULL,NULL,NULL,NULL),(628,2952,1,'2020-09-03 16:13:48','2020-09-03 20:13:48','2020-09-03 20:13:48','5c0f41c3-b5f4-46c5-8dc3-0804856eac19',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(629,2953,1,'2020-09-04 11:18:02','2020-09-04 15:18:02','2020-09-04 15:18:02','91f84879-7b3b-4a66-9654-9e431750233e',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(630,2954,1,'Sure Comfort heat pump training','2020-09-05 19:57:02','2020-09-05 19:57:02','4f3c5f92-cf32-41e7-bc56-6657f9631701',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Zoom - Link to be 