with Cushman Enterprises Inc. and I would like to purchase Doors from your company,Kindly get back to me so we can proceed with this order. Thank you and Hoping to hear back from you soon.\r\n\r\nRegards,\r\nSteve Cushman',NULL,NULL,NULL,NULL,NULL,NULL,NULL),(1952,17,2,1,'zHPqjkXa8R6no1sUKSy97q7HMrAcnH6fYNUnXAztpSvwrYCp93IHcbrZUWMQHTZjWZ4sRRVAj1YS3D7rSv9IU1ELrJOWmDkhOsG5','99.203.21.87',0,'2019-10-09 19:12:26','2019-10-09 19:12:26','14e0aa4f-a7e3-4f9a-b540-3921f44b11e5','Sam','Victory','[\"samv@wisemanbrewing.com\"]',NULL,NULL,NULL,NULL,NULL,NULL,'General Questions','Do you sale Reme Halo?',NULL,NULL,NULL,NULL,NULL,NULL,NULL),(1953,18,2,1,'5lpMzOKE0rNWjkc0J3Uit2hZKNzU7kr3PHmrCsFRHjPkXwQoeSDnQEnAE122M1bhHxXIvZ0YOqzXPLyIIUZSS4U5Uczfe3LCgXtz','92.38.148.60',0,'2019-10-10 17:02:12','2019-10-10 17:02:12','6bebc904-5156-40d6-8bb3-baccb01d082a','Rolando','Tiope','[\"rolando@royalimagingsolutions.com\"]',NULL,NULL,NULL,NULL,NULL,NULL,'General Questions','Good Afternoon Sales,\r\n\r\nCan you please provide me quote for York Central Station Air Handler Model: XTI-38X126-E-H-0-17\r\nQty. 1 ea.\r\nAmerican Chiller DAP 1003-208-230/3/60 Air Cooled Package Chiller With Tank and Pump\r\nQty. 1 ea.\r\n\r\n\r\nShip to: Raleigh, NC 27603\r\n\r\nCan you please include needed information below;\r\n\r\n1)       Availability / on hand Lead time (if made to order) \r\n2)       ETA to Raleigh, NC 27603\r\n3)       Taxes (if theres any) \r\n4)       Mode of payment                    \r\n5)       Credit card fee (if theres any) \r\n6)       For credit card payments, is partial payment ok? (50% upfront - 50% before shipping)\r\n7)       How much the Installation Cost?\r\n8)       Freight charge to Raleigh, NC 27603\r\n9)       Handling fee (if theres any)\r\n10)    Country of Origin\r\n11)    Place of Manufacturing\r\n12)    Validity of Quote\r\n13)    Manufacturers Warranty\r\n\r\nVery respectfully,\r\n\r\nRolando Tiope | Sales Associate | P: 667-401-8415 | F: 443.927.7378 | rolando@royalim