but hauling water, toilet paper, and other goods needed in the US supply chain worked out well for the fleet the last few months. \r\n\r\nWith that being said upper management is making a push to dedicate 25% of our asset trucks into a more traditional public fleet model.  This is a project in the very infant stage as we have yet to hook our wagons to any one customer.  To date, it has all been onesies and twosies of broker freight and customer freight direct mix.  This is where you come in!  Can you help us develop the lanes in between our DCs which are strategically located all across the US?  At the moment I have about 14 trucks in hand that can be repositioned for the right project or long term footprint immediately.\r\n\r\nDirectly partnered with Ashley Distribution Services, Ltd. (ADS), the private fleet for our parent company Ashley Furniture Industries, we deliver furniture throughout the continental United States every week of the year.  Operating this close with our private fleet of over 900+ tractors and 3700+ trailers allows us to offer competitive rates along the nations major interstate corridors whether live load, drop trailer, power only, slip seat drivers, and load relays which in most cases are harder services to find to keep the loads moving.  Ranked #39 on TransportTopics.com we have one of the most comprehensive transportation networks available nationwide.  We not only specialize in handling furniture(#1 in the World), but have transitioned this into beverage(Anheuser-Buschs Carrier of the Year), consumer packaged goods(CaseStacks Carrier of the Year), raw materials(to and from our DCs nationwide), pharmaceuticals and more!\r\n\r\nOur trucks are largely and strategically based in Arcadia, WI; Ecru, MS; Redland, CA; Advance, NC; Leesport, PA and Mesquite, TX and always ready to go for regional projects based on your companys freight movement needs insured up to $250,000 each load.  We also have 1 of only 7 privately owned intermodal rail ramps in North America located in Arcadia, WI in order to maximize customer savings on long-hauls and short hauls to Chicago, IL area currently limited for use to only a few companies we let access.  With 400 Chassis on-site (300 owned) we move, on average, 260  40 containers each week!\r\n\r\nOur goal is to start in the TX/LA Market going back to IL/MN/IN/WI market immediately.  If you have similar lanes then we should talk!\r\n\r\nOther possible Day 1 options include:\r\n\r\nAdvance, NC (90 Miles Radius preferred) to CA/WA/PA/TX/MS/WI\r\nEcru, MS (90 Miles Radius preferred) to CA/WA/PA/TX/NC/WI\r\nMesquite, TX (90 Miles Radius preferred) to CA/WA/PA/NC/MS/WI\r\nRedlands, CA (90 Miles Radius preferred) to NC/WA/PA/TX/MS/WI\r\nTacoma, WA(90 Miles Radius preferred) to CA/NC/PA/TX/MS/WI\r\nLeesport, PA (90 Miles Radius preferred) to CA/WA/NC/TX/MS/WI\r\nArcadia, WI (90 Miles Radius preferred) to CA/WA/NC/TX/MS/PA\r\n\r\nWe have many other drop yards and retail DCs where our fleet makes picks and drops that fill in the areas in the US where coverage is needed.  Our network basically blankets the US and we truly can provide coverage where most trucking companies half our size cant even move a truck.\r\n\r\nAs a Smartway partner, we practice what we preach in terms of driver safety.  We have a remarkable safety record with no CSA alerts and a Satisfactory DOT safety rating.  Believe it or not our drivers are also happy at Ashley!  We treat our drivers with respect well and pay them well which translates into having one of the lowest driver turnover ratios in the industry and among our peers.  This should give you the peace of mind that comes with knowing your freight is on the truck of an experienced professional who enjoys what they do, takes it seriously, and makes appointments on time.  As CaseStacks carrier of the year we have at some point held and maintained the exceptional standard of 100% on time delivery, 99% load tender acceptance rate, 98% POD recovery rate and zero claims demonstrating our continued commitment to providing the level of customer service that is essential to CaseStacks operations.\r\n\r\nWe have the reputation, equipment, and financial backing to compete directly with any fleet in the industry, but will move at our own speed to make sure growth continues to come organically and we do things right the first time, every time. \r\n\r\nThanks again for your time and consideration in the matter!  Look forward to speaking with you soon!\r\n',NULL,NULL,NULL,NULL,NULL,NULL,NULL),(2481,250,2,1,'x5iQHBbzLMoo3hN7725SZIlocfp1kO8Oym7KXtzAPGMHKfyRgTPqiScMZJJuDiqEQHSx3P0LBy6KxPXSjzEICpox1jspmcvpbFIa','23.119.212.14',0,'2020-06-30 12:58:26','2020-06-30 12:58:26','e43b1e9b-aa96-40ee-b8e6-653d356ff4bc','Alex','Alexis','[\"ajalexis56@yahoo.com\"]',NULL,NULL,NULL,NULL,NULL,NULL,'General Questions','Im in the process of applying for cash account. To attach a picture of my EPA certification I cannot. The Raleigh store has a copy of my certificate.',NULL,NULL,NULL,NULL,NULL,NULL,NULL),(2482,251,2,1,'GwhHNbvLw0e2CVR24AiCoJKkKf7TU8RVXxgIru5gQMDpCFa9d7s1oGqnxv8AaPokX2EEIJU19gj0elkE1vQMns6a63A6RxlEoJTr','154.118.31.182',0,'2020-06-30 19:38:33','2020-06-30 19:38:33','8b3f9a96-4ed5-427a-af1e-159d8603426d','Ron','Williams','[\"powersupplyinc011@gmail.com\"]',NULL,NULL,NULL,NULL,NULL,NULL,'Engineering Solutions','\r\nHello,\r\n\r\n  WE WOULD LIKE TO INQUIRE THE BELOW LISTED\r\n\r\nITEMS AND IF YOU CAN ALSO SPECIAL ORDER\r\n\r\n        Grundfos submersible well pump\r\n\r\n1:Grundfos 15SQ10-250 1Hp	200-240Volts  #96160151\r\n\r\n2:Grundfos5SQ07-270 3/4HP 200-240Volts  #96160134\r\n\r\nKINDLY GET US PRICING AND AVAILABILITY , AS\r\n\r\nWELL LETS KNOW THE MODE OF PAYMENT WHEN WE\r\n\r\nPURCHASED FROM YOUR COMPANY.\r\n\r\nBest Regards,\r\n\r\n\r\nRon Williams\r\nPOWER SUPPLY INC\r\n660-246-2571\r\npowersupplyinc011@gmail.com',NULL,NULL,NULL,NULL,NULL,NULL,NULL),(2483,252,2,1,'u5txC3Kw12M03o6njMrrJkPcBx64vzOFYiG2s9n1dvGLrpBGtwZyQXDIAxsf76wGq5uNkvX