s its customers acr supply has a culture where god is glorified through integrity respect for each other and hard work in order to serve our customers always seeking to change and better others beliefs attitudes behaviors witch we use everyday build relationships impact lives and glorify god caring for its employees and customers caring friendly dependable team members and ethical inspirational leadership caring fun and productive christian mindset and values with exceptional teams and people customer care customer focused give purpose serve others double standards ethical everyone seems happy intelligent and trustworthy everyone works together as a team family excellent conducting business with morality faith based faith based while serving others fake family family and associates come first family strong family sometimes you love your family sometimes it annoys you but its always family forever changing fun fun high morale glass half full attitude god customers and great team work good good community of people to work with that value customer service and striving for excellence i am part of a special team inside a nice family i believe the culture that acr has tried to cultivate over the years has taken a hit recently maybe due to the company getting larger or not having the proper leadership in place i dont hear a lot of the positive things happening at least at the store level each department with in the company seems to work exclusively in and of itself whereas in years past we all seemed to be pulling in the same direction i think everyone has a great culture within there dept or stores i think the culture is waning people are feeling overwhelmed and under appreciated i would describe the culture at acr as one with a high emphasis on meeting customer requests we are not the cheapest supplier but i believe we have the best inside sales representatives in the area which drives the customer experience i think people have bought into that culture and enjoy the tea